import React, { Component } from "react";
import "./Entry.css";
import Login from "./Login/Login";

export default class Entry extends Component {
  state = {
    showRegister: false
  }
  render() {
    return (
      <div className="Entry">
        <Login />
      </div>
    );
  }
}
